func test3(s string) int{
	lenth := len(s)
	set := []byte{}
	count := 0
	i := 0
	j := 0
	for i<lenth && j <lenth{
		if bytes.Contains(set, []byte(s)[j:j+1]) {
			bytes.LastIndex(set, []byte(s)[j:j+1])
			set = set[bytes.LastIndex(set, []byte(s)[j:j+1]):len(set)]
			i = i + bytes.LastIndex(set, []byte(s)[j:j+1]) + 1
		} else {
			set = append(set, s[j])
			j++
			if count < j - i {
				count = j - i
			}
		}
	}
	return count
}